import './App.css';
import Footer from './Components/Footer';
import Header from './Components/Header';
import Note from './Note';

function App() {
  return (
    <>
      <Header />
      <Footer />
      <Note title = "DP" content = "Those who don't remember the past are contemped to repeat it..."/>
      <Note title = "Stack" content = "Stack is LIFO data structure and real"/>
    </>
  );
}

export default App;
